import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import { Box } from "@mui/system";
import Cara from "../../img/Cara.png";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import MenuIcon from "@mui/icons-material/Menu";
function Navbar() {
  const [current, update] = useState("null");
  const nav = document.getElementsByClassName("Navbar_items");
  const clicked = () => {
    update(nav.classList.add("active"));
  };
  return (
    <>
      <section className="Navbar_main">
        <img src={Cara} alt="erroe" className="Navbar_logo" />
        <div className="Navbar_items">
          <Link to="/" className="Navbar_links active">
            Home
          </Link>
          <Link to="/About" className="Navbar_links">
            About
          </Link>
          <Link to="/Blog" className="Navbar_links">
            Blog
          </Link>
          <Link to="/Shop" className="Navbar_links">
            Shop
          </Link>
          <Link to="/Contact" className="Navbar_links">
            Contact
          </Link>
          <Link to="/Cart" className="Navbar_links ">
            <ShoppingCartIcon className="Navbar_cart" />
          </Link>
        </div>
        <div id="id">
          <MenuIcon onClick={clicked} className="bar" />
          <ShoppingCartIcon className="Navbar_car" />
        </div>
      </section>
    </>
  );
}

export default Navbar;
